        console.log("clicked")
        display.push(<Address />)
        console.log(display)
    }

    return (
        <div>
            <h1>Payment</h1>
            <div className="payment-sheet">
                <div>
                    <button onClick={() => getCardForm()}>Pick Up</button>
                    <button onClick={() => getAddressForm()}>Delivery</button>
                </div>
            </div>
            <div>
                {display}
                <Address />
            </div>
        </div>
    )
}

export default Payment
